import React from 'react'
import '../css/Menu.css'

function Menu() {

    const OpenForm = () => {
        return (
            <form>
                <label for="name">Name:</label>
                <input type="text"
                    name="name_system"
                    value="" />
                <input type="button"
                    value="Создать" />
            </form>
        )
    }

    return (
        <div className="menu_system">
            <button onClick={OpenForm} className="add__btn">Добавить</button>
        </div>
    )
}

export default Menu
